import React from "react";
import { View, StyleSheet, Image, Text } from "react-native-web";
import {imagem} from "../../../assets/tela_principal.png"

const TelaPrincipal = () => {
    return (
        <View>
            <Image source = {"../../../assets/tela_principal.png"} style = {estilos.Image}/>
            <Text>TEste</Text>
        </View>
    )
}

export default TelaPrincipal;

const estilos = StyleSheet.create({

    imagem: {
        width: "100%",
        height: "50%"
    }

})
